  public static int lengthOfLongestSubstring(String s) {
    Date start = new Date();
    int maxLength = 0;

    char[] array = new char[s.length()];
    s.getChars(0, s.length(), array, 0);
    LinkedList<Character> list = new LinkedList<>();
    for (char ch : array) {
      while (list.contains(ch)) {
        list.removeFirst();
      }
      list.add(ch);
      maxLength = maxLength < list.size() ? list.size() : maxLength;
    }

    // for (int i = 0; i < s.length(); i++) {
    // int tmpMaxLength = lengthOfFirstUniqueDifferentLetters(s.substring(i));
    // maxLength = maxLength < tmpMaxLength ? tmpMaxLength : maxLength;
    // }

    Date end = new Date();
    System.out.println("time: " + String.valueOf(end.getTime() - start.getTime()));

    return maxLength;
  }

  public static int lengthOfFirstUniqueDifferentLetters(String s) {
    int maxLength = 0;
    int length = 0;
    Set<Character> set = new HashSet<>();
    for (int i = 0; i < s.length(); i++) {
      if (set.contains(s.charAt(i))) {
        return maxLength;
      } else {
        length++;
        maxLength = maxLength < length ? length : maxLength;
      }
      set.add(s.charAt(i));
    }

    return maxLength;
  }
